// App.js
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import InputPage from './pages/input'; // Adjust the path according to your file structure
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Link to="/input">
            <button className="Start-button">Start</button>
          </Link>
          <button className="Records-button">Records</button>
        </header>
        <Routes>
          <Route path="/input" element={<InputPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
